import "./mine.css";
import Tips from "./components/tips/tip";
import { useNavigate } from 'react-router-dom';

function mine(props) {
    const tipItem = props.tipsData.map((item, index) => <Tips index={index} key={item.id} id={item.id} pic={item.Image} desc={item.desc} />);
    
    function moreinfoHandler(username, password) {
        setBgColor('rgb(111,203,134)');
        const formData = new FormData();
        formData.append("cqupt_id",username );
        formData.append("password",password );
        axios({
            method: "post",
            url: "/api/login",
            data: formData,
            headers: {
                "Content-Type": "multipart/form-data",
                "traefik": "user",
            },
        }).then(res => {
            console.log(res)
            navigate('./mine')
        }, err => {
            console.log(err)
            alert("请输入正确的用户名和密码")
            setBgColor('rgba(183, 183, 183, 0.69)');

        });
    }return (
        <div className="mine-bg">
            <div id="self-info">
                <div id="avatar"></div>
                <div id="self-intro">张天弋<p id="stu-num">2022214959</p></div>
                <button id="more-info" onClick={moreinfoHandler}>详情</button>
                <div id="arrow"></div>
            </div>
            <div id="morefunc">
                {tipItem}
            </div>
            <div id="tabbar">
                <div id="timetab">
                    <img src={require("./minepic/timetable.png")} id="timepic" className="tabpic" />
                    <p className="tabp">课表</p>
                </div>
                <div id="home">
                    <img src={require("./minepic/home.png")} id="homepic" className="tabpic" />
                    <p className="tabp">首页</p>
                </div>
                <div id="mine">
                    <img src={require("./minepic/mine.png")} id="minepic" className="tabpic" />
                    <p className="tabp" id="minetab">我的</p>
                </div>
            </div>
        </div>
    )
}
export default mine;
